src_script:
// this line should not be removed
var wBPMSelectCandidate = angular.module( "wBPMSelectCandidate",[]);

wBPMSelectCandidate.controller( "wBPMSelectCandidateController", function( $scope ) {


    //---------------------- This code is executed the first time the widget is created --------------------------
    $scope.showWatsonPanel = false;

    //-------------- Get Task Details
    var dq = new DataQuery( 'qBPMGetTaskDetails' );
    //$scope.taskId = '68';
    $scope.taskId = sessionStorage.taskId;
    dq.setParameters( {"task_id": $scope.taskId} );
    dq.execute().
        done( function() {
            $scope.$apply(function() {
                $scope.results = dq.getData().data;
                $scope.task_details = $scope.results.data.variables;
                $scope.piid = $scope.results.piid;
                //console.log($scope.task_details);
            });
        });

            //----------------- Search the list of available candidates for the job, then position the selection by default to the firs ton the list as selCandidate
            var dq2 = new DataQuery( 'qBPMGetListCandidates' );
            dq2.execute().
            	done( function() {
            		$scope.$apply(function() {
            			$scope.candidates = dq2.getData().data;
            			//Display first item in the array
            			$scope.currentIndex = 0
            			$scope.selCandidate = $scope.candidates[$scope.currentIndex];
            			//console.log($scope.selCandidate);
            		});
            	});
    //-------------- End function


    //-------------- Change the index of the "card" to be shown" and apply it to the "model structure" used by the GC
    $scope.navigate = function(arg) {

        $scope.currentIndex = $scope.currentIndex + arg;

        if ($scope.currentIndex < 0) {
            $scope.currentIndex = $scope.candidates.length - 1;
        } else if ($scope.currentIndex >= $scope.candidates.length) {
            $scope.currentIndex = 0 ;
        }

        $scope.selCandidate = $scope.candidates[$scope.currentIndex]; 

        //Hide the Watson Panel , in case it was showing
        $scope.showWatsonPanel = false;

        return '';
    }; 
    //-------------- End function

    //----------------- function that calls twitter then Watson and returns Personality Insights from Watson
    $scope.analyzeTwitterWatson = function() { 

        //first query returns concatinated response from twitter
        var dq = new DataQuery( 'qTwitterConcat' );
        dq.setParameters({"screen_name":$scope.selCandidate.contact.twitter});
        dq.execute().
        	done( function() {
        		$scope.$apply(function() {
        			var twits = dq.getData();
        			//removing special characters to make it a valid input for watson
        			var tw=twits[0].replace(/[^a-zA-Z ]/g, "");
        			//console.log(tw.toString());
        			//defining request body of second watson query
                    var second_body={"contentItems": [
                        {
                            "id": "xxx",
                            "userid": "abc",
                            "sourceid": "twitter",
                            "contenttype": "text/plain",
                            "language": "en",
                            "content":tw
                        }
                    ]};
                    //we are inside the first query and we will call the second watson query
        			var dq1 = new DataQuery( 'qWatsonUserModeling' );
        			dq1.setReqBody(second_body);
                    dq1.execute().
                    	done( function() {
                    		$scope.$apply(function() {
                    			$scope.moods = dq1.getData().tree.children;
                    			//Show the panel that shows the results
                    			$scope.showWatsonPanel = true;
                    		});
                    	});
        		});
        	});
        };
    //-------------- End function


    //-------------- Move the hiring process by choosing the selected candidate, display a success alert and return to Home page
    $scope.proceedWithCandidate = function(arg) {

        var dq_sel_candidate = new DataQuery( 'qBPMSelectCandidate' );
        dq_sel_candidate.setParameters(
            {   "task_id": $scope.taskId,
                "action": "finish",
                "decision": "",
                "lastName": $scope.selCandidate.lastName,
                "firstName": $scope.selCandidate.firstName,
                "supervisor": $scope.selCandidate.supervisor,
                "payLevel": $scope.selCandidate.payLevel,
                "payType": "full time",
                "hrcandidateAvailable": true
            }
        );
        dq_sel_candidate.execute().
            done( function() {
                $scope.alertSuccess();
                loadURL("sDashboard.html");
            });

    };
    //-------------- End function

    //-------------- Utility funtion that displays a fancy Success message
    $scope.alertSuccess = function () {

        var alertMessage = "You have just selected to hire " + $scope.selCandidate.name + " for open job requisition " + $scope.taskId;

        $.smallBox({
            title: "Your selection of a new candidate has been submitted",
            content: "<i class='fa fa-check'></i> <i>" + "   " + alertMessage + "</i>",
            color: "#296191",
            iconSmall: "fa fa-thumbs-up bounce animated",
            timeout: 6000
        });
    };
    //-------------- End function

});

